import React from "react";
import LoginForm from "./components/LoginForm";
import "./App.css"
import { BrowserRouter as Router, Switch, Route, Routes } from "react-router-dom";



function App() {
  return (
    <Router>
      <Routes>
        <div className="App">
          <Route path="/login" component={<LoginForm />}></Route>
        </div>
      </Routes>
    </Router>
  );
}

export default App;
